B.Ml=A.a(s(["Ist der Abstand zwischen den beiden Atomen hinreichend gro\xdf, so stehen diese nicht miteinander in Wechselwirkung. Die m\xf6glichen Energiewerte, die die beiden Atome annehmen k\xf6nnen, liegen auf der gleichen H\xf6he wie bei einem einzelnen Atom.","Bringt man die beiden Atome n\xe4her zusammen, so \xfcberlappen sich die Elektronenbahnen und beide Atome treten miteinander in Wechselwirkung. Dies bewirkt - \xe4hnlich wie bei gekoppelten Resonatoren - eine Aufspaltung der m\xf6glichen Energieniveaus, die um so st\xe4rker ist, je gr\xf6\xdfer die Kopplung, d.h. je geringer der Abstand zwischen den beiden Atomen ist."]),t.i)
