B.oI=A.a(s(["Die blaue Kurve entspricht der Kennlinie des Stromspiegels T1 und T2 und stellt damit die Lastkurve dar. Die rote Kurve entspricht der Ausgangskennlinie des Verst\xe4rkertransistors T3.","Der Schnittpunkt der beiden Kennlinien liefert den Wert des Stromes IC,A durch T2 und T3 sowie der Ausgangsspannung UCE,A im Arbeitspunkt.","Der Arbeitspunkt, d.h. der Strom IC,A durch die Transistoren T2 und T3 sowie die Spannung UCE,A am Ausgang der Schaltung l\xe4sst sich bei einer vorgegebenen Spannung UBE,A durch den Transistorparameter IS3 beeinflussen. IS3 kann dabei z.B. \xfcber die Gr\xf6\xdfe des Transistors T3 eingestellt werden.Der Strom IC,A ist dabei im Wesentlichen durch den Stromspiegel T1 und T2 eingepr\xe4gt und \xe4ndert sich daher auch bei \xc4nderungen des Transistorparameters IS3 nur sehr wenig.","Die Spannung UCE,A im Arbeitspunkt reagiert jedoch sehr empfindlich auf \xc4nderungen des Parameters IS3. Diese Empfindlichkeit wird um so gr\xf6\xdfer, je geringer der Early-Effekt ist, d.h. je gr\xf6\xdfer die Early-Spannung Uan ist."]),t.i)
